import React from 'react';
import '../index.scss';

const Favorites = () => {
  return (
    <section class="content">
      <h1>Мои любимые</h1>
      <div class="cards">
        <div class="card">
          <img class="like" src="/img/like2.png" alt="" />
          <img src="/img/sneakers/sneak5.png" alt="" />
          <div class="cardofitems">
            <div class="card-name">
              <p class="name-line">Nike Dunk Low Red</p>
              <p class="price-line">15999 p.</p>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Favorites;
